import React from 'react';
import { useParams } from 'react-router-dom';

const ProductDetails = () => {
    const params = useParams()
    return (
        <section>
            <h1>Product Detail</h1>
            <p>{params}</p>
        </section>
    );
};

export default ProductDetails;
